import React, { useEffect, useState } from 'react';
import socket from '../socket';
import Board from './Board';
import Chat from './Chat';

const containerStyle = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'flex-start',
  gap: 30,
  padding: 20,
  fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  backgroundColor: '#f0f4f8',
  minHeight: '100vh',
};

const gameAreaStyle = {
  backgroundColor: 'white',
  padding: 20,
  borderRadius: 10,
  boxShadow: '0 4px 15px rgba(0,0,0,0.1)',
  width: 300,
  textAlign: 'center',
};

const statusStyle = {
  marginBottom: 15,
  fontSize: 18,
  fontWeight: '600',
  color: '#333',
  minHeight: 28,
};

const buttonGroupStyle = {
  marginTop: 20,
  display: 'flex',
  justifyContent: 'space-between',
};

const buttonStyle = {
  padding: '8px 16px',
  borderRadius: 6,
  border: 'none',
  cursor: 'pointer',
  fontWeight: '600',
  fontSize: 14,
  boxShadow: '0 2px 6px rgba(0,0,0,0.15)',
  transition: 'background-color 0.3s',
};

const restartBtnStyle = {
  ...buttonStyle,
  backgroundColor: '#4caf50',
  color: 'white',
};

const exitBtnStyle = {
  ...buttonStyle,
  backgroundColor: '#f44336',
  color: 'white',
};

function Room({ username, roomId }) {

    console.log()
  const [board, setBoard] = useState(Array(9).fill(''));
  const [turn, setTurn] = useState('X');
  const [status, setStatus] = useState('');
  const [gameOver, setGameOver] = useState(false);
  const [players, setPlayers] = useState({});

  useEffect(() => {
    console.log('Joining room:', roomId, 'as', username);
    socket.emit('join_room', { roomId, username });

    socket.on('game_state', ({ board, turn, status, gameOver }) => {
      setBoard(board);
      setTurn(turn);
      setStatus(status);
      setGameOver(gameOver);
    });

    socket.on('players', (playersData) => {
      console.log('Players updated:', playersData);
      setPlayers(playersData);
    });

    socket.on('game_reset', () => {
      setBoard(Array(9).fill(''));
      setTurn('X');
      setStatus('');
      setGameOver(false);
    });

    return () => {
      socket.emit('leave_room', { roomId, username });
      socket.off('game_state');
      socket.off('players');
      socket.off('game_reset');
    };
  }, [roomId, username]);

  const handleCellClick = (index) => {
    if (board[index] || gameOver) return;
    socket.emit('make_move', { roomId, username, index });
  };

  const handleRestart = () => {
    socket.emit('restart_game', { roomId });
  };

  const handleExit = () => {
    socket.emit('leave_room', { roomId, username });
    window.location.reload();
  };

  const playerSymbol = players[username];

  return (
    <div style={containerStyle}>
      <div style={gameAreaStyle}>
        <h2 style={{ marginBottom: 10 }}>Room: {roomId}</h2>
        <div style={statusStyle}>
          {playerSymbol ? (
            gameOver ? (
              status
            ) : (
              <>
                Your Symbol: <strong>{playerSymbol}</strong> | Turn:{' '}
                <strong>{turn}</strong>
              </>
            )
          ) : (
            'Waiting for players...'
          )}
        </div>
        <Board board={board} onCellClick={handleCellClick} />
        <div style={buttonGroupStyle}>
          <button
            onClick={handleRestart}
            disabled={!gameOver}
            style={{
              ...restartBtnStyle,
              opacity: gameOver ? 1 : 0.5,
            }}
            title={gameOver ? 'Restart Game' : 'Restart available after game ends'}
          >
            Restart Game
          </button>
          <button onClick={handleExit} style={exitBtnStyle} title="Exit Room">
            Exit Room
          </button>
        </div>
      </div>

      <Chat roomId={roomId} username={username} />
    </div>
  );
}

export default Room;
